&quot;If I Lose Myself&quot; is a pop rock, dance-pop, and house song that runs for 4:01. It has a tempo of 140 beats per minute.
 Tedder put it like this in an MTV interview: &quot;Even though [&quot;If I Lose Myself&quot;] sounds like this euphoric, 'let's go crazy tonight' song, it's a bit morbid; it's about going down in an airplane. Waking up on an airplane and finding out you're going down, having that moment of sheer panic, looking out the window, seeing your life pass before you, [but] looking over to your right and seeing the person you love sitting next to you, and realizing 'It could be worse ... the next 90 seconds are going to be pretty thrilling, and this person is with me, so I'm OK.'&quot;

